        {/* <img src={backgroundWave} alt="" /> */}
        <div className="d-flex">
          <div className="">
            <img src="" alt="" />
          </div>
          <h3>Be one of the first to know when we launch!</h3>
        </div>
      </div>
    </section>
  );
};

export default MailSubscribe;
